import React from "react";
import { Menu } from "semantic-ui-react";

export default () => {
  return (
    <Menu style={{ marginTop: "1%" }}>
      <Menu.Item>
        <img src="/static/Identity.png" />
      </Menu.Item>
      <Menu.Item>Home</Menu.Item>
    </Menu>
  );
};
